import React from "react";

class Box extends React.Component {
  render() {
    return (
      <div class="border border box-container">
        <p>Your balance is:</p>
        <button>Increment</button>
        <button>Decrement</button>
        <button>Reset</button>
      </div>
    );
  }
}

export default Box;
